import planos from './Planos.png';
import { BrowserRouter as Router, Route }from 'react-router-dom';

function Planos() {
  const Planos = <img src={planos} className='PlanoDeAula' alt="Planos de aula" />
  return (
     <Router>
      <div>
        <Route path='/plans' component={Planos}>
         <div id='Principais'>   
         {Planos}
        </div>
        </Route>
      </div>
    </Router>
  );
}

export default Planos;
